import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const Partnership = () => {
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    lookingFor: "",
  });

  const handleSearch = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log("Search params:", searchParams);
  };

  return (
    <div className="min-h-screen bg-white">
      {/* Hero Section */}
      <div className="relative bg-gradient-to-r from-teal-500 to-blue-500 py-32">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="text-center">
            <h1 className="text-4xl font-bold text-white sm:text-5xl md:text-6xl">
              Let's Find Your Perfect Partner
            </h1>
            <p className="mt-3 max-w-md mx-auto text-base text-white sm:text-lg md:mt-5 md:text-xl md:max-w-3xl">
              Connect with organizations that share your values and mission.
              Create meaningful partnerships that drive impact.
            </p>
          </div>

          {/* Search Form */}
          <div className="mt-10">
            <div className="max-w-3xl mx-auto bg-white rounded-lg shadow-lg overflow-hidden">
              <form onSubmit={handleSearch} className="p-6">
                <div className="grid grid-cols-1 gap-6">
                  <div>
                    <label className="block text-sm font-medium text-gray-700">
                      Location
                    </label>
                    <input
                      type="text"
                      className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-teal-500 focus:ring-teal-500"
                      placeholder="Enter location"
                      value={searchParams.location}
                      onChange={(e) =>
                        setSearchParams({
                          ...searchParams,
                          location: e.target.value,
                        })
                      }
                    />
                  </div>

                  <div>
                    <label className="block text-sm font-medium text-gray-700">
                      Organization Type
                    </label>
                    <select
                      className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-teal-500 focus:ring-teal-500"
                      value={searchParams.orgType}
                      onChange={(e) =>
                        setSearchParams({
                          ...searchParams,
                          orgType: e.target.value,
                        })
                      }
                    >
                      <option value="">Select type</option>
                      <option value="nonprofit">Nonprofit</option>
                      <option value="forprofit">For-Profit</option>
                      <option value="social">Social Enterprise</option>
                      <option value="government">Government</option>
                    </select>
                  </div>

                  <div>
                    <label className="block text-sm font-medium text-gray-700">
                      What Kind of Organization Are You Looking For?
                    </label>
                    <textarea
                      className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-teal-500 focus:ring-teal-500"
                      rows="3"
                      placeholder="Describe your ideal partner organization..."
                      value={searchParams.lookingFor}
                      onChange={(e) =>
                        setSearchParams({
                          ...searchParams,
                          lookingFor: e.target.value,
                        })
                      }
                    />
                  </div>

                  <div>
                    <button
                      type="submit"
                      className="w-full flex justify-center py-3 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-teal-600 hover:bg-teal-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-teal-500"
                    >
                      Find Partners
                    </button>
                  </div>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Partnership;
